// Setup Canvas & Set Global Variables Values
function setup() {
  createCanvas(windowWidth, headerMargin + footerMargin + (distBetweenGames*11)+(gameBoxHeight*12) );
  centerWidth = windowWidth/2;
  centerHeight = height/2;
  setBoxProperties();
  
  rectMode(CORNERS);
  textWrap(WORD);
  noStroke();
  
  frameRate(frame_rate);
  beatsPerSecond = beatsPerMinute/60;
  
  // Music Stuff
  // getAudioContext().suspend();
  for(var i = 0; i < 24; i++ ) {
    trackAmplitude[i] = new p5.Amplitude();
  }
  Howler.volume(0.5);
  
  soundToggleButton = createButton('Sound: ON');
  soundToggleButton.position(centerWidth,headerMargin-60);
  soundToggleButton.mousePressed(toggleAudio);
  soundToggleButton.center("horizontal");
}

function windowResized() {
  resizeCanvas(windowWidth, headerMargin + footerMargin + (distBetweenGames*11)+(gameBoxHeight*12) );
  centerWidth = windowWidth/2;
  centerHeight = height/2;
  setBoxProperties();
  soundToggleButton.center("horizontal");
}






function draw() {
  background(0);
  
  for (let x=0; x < width; x++) {
    let noiseVal = noise(((cos(frameCount/beatsPerSecond/60)+1)+x+frameCount/2)*0.008, (sin(frameCount/beatsPerSecond/15)+1)*0.2);
    //noiseVal = Math.round(noiseVal*20)/20;
    stroke( noiseVal*200 - 75, (cos(frameCount/60)+1)*25 - 50, (cos(frameCount/120)+1)*100*noiseVal - 50);
    //line(x, 10+noiseVal*80, x, height);
    line(x, 0, x, height);
    //line(centerWidth, centerHeight, centerWidth+(cos((6.28*x/width)+frameCount/100)*width), centerHeight+(sin((6.28*x/width)+frameCount/100)*height));
  }
  noStroke();
  
  var startNewTrack = false;
  beatTimer += deltaTime;
  if( beatTimer > 960/beatsPerMinute ) {
    startNewTrack = true;
    beatTimer -= 960/beatsPerMinute;
  }
  
  for( var i = 0; i < 12; i++ ) {
    fill(mainBoxesBgColor);
    rect(infoBoxProperties.leftBorderX,infoBoxProperties.upperBorderY+((distBetweenGames+gameBoxHeight)*i),infoBoxProperties.rightBorderX,infoBoxProperties.bottomBorderY+((distBetweenGames+gameBoxHeight)*i),mainBoxesCornerRoundness);
    rect(scoreBoxProperties.leftBorderX,scoreBoxProperties.upperBorderY+((distBetweenGames+gameBoxHeight)*i),scoreBoxProperties.rightBorderX,scoreBoxProperties.bottomBorderY+((distBetweenGames+gameBoxHeight)*i),mainBoxesCornerRoundness);
    rect(updateBoxProperties.leftBorderX,updateBoxProperties.upperBorderY+((distBetweenGames+gameBoxHeight)*i),updateBoxProperties.rightBorderX,updateBoxProperties.bottomBorderY+((distBetweenGames+gameBoxHeight)*i),mainBoxesCornerRoundness);
    
    fill(30); 
    rect(updateBoxProperties.leftBorderX,updateBoxProperties.upperBorderY + ((distBetweenGames+gameBoxHeight)*i),updateBoxProperties.rightBorderX,updateBoxProperties.upperBorderY + 30 + ((distBetweenGames+gameBoxHeight)*i), mainBoxesCornerRoundness, mainBoxesCornerRoundness, 0, 0);
    rect(scoreBoxProperties.leftBorderX,scoreBoxProperties.upperBorderY + ((distBetweenGames+gameBoxHeight)*i),scoreBoxProperties.rightBorderX,scoreBoxProperties.upperBorderY + 30 + ((distBetweenGames+gameBoxHeight)*i), mainBoxesCornerRoundness, mainBoxesCornerRoundness, 0, 0);
    
    fill(255);
    textSize(13);
    textAlign(CENTER,CENTER);
    text( "GAME LOG", updateBoxProperties.leftBorderX + (updateBoxProperties.width/2), updateBoxProperties.upperBorderY + 15 + ((gameBoxHeight+distBetweenGames)*i) );

    
    if(games[0] != null) {
      fill(75);
      textSize(13);
      textAlign(RIGHT,BOTTOM);
      text( games[i].playCount, updateBoxProperties.rightBorderX-5, updateBoxProperties.bottomBorderY - 7 + ((gameBoxHeight+distBetweenGames)*i) );
      
      textAlign(LEFT,CENTER);
      let inningBGWidth = textWidth("FINAL");
      if(!games[i].finalized) {
        var inningArrow = " ▲";
        if(!games[i].topOfInning) {
          inningArrow = " ▼";
        }
        fill( 0, 150, 0 );
        inningBGWidth = textWidth("Live - " + (games[i].inning+1) + inningArrow);
        rect(scoreBoxProperties.leftBorderX,scoreBoxProperties.upperBorderY + ((distBetweenGames+gameBoxHeight)*i),scoreBoxProperties.leftBorderX+16+inningBGWidth,scoreBoxProperties.upperBorderY + 30 + ((distBetweenGames+gameBoxHeight)*i), mainBoxesCornerRoundness, mainBoxesCornerRoundness, mainBoxesCornerRoundness, mainBoxesCornerRoundness );
        fill( 255 );
        text( "Live - " + (games[i].inning+1) + inningArrow, scoreBoxProperties.leftBorderX + 8, scoreBoxProperties.upperBorderY + 15 + ((gameBoxHeight+distBetweenGames)*i) );
      } else {
        fill( 255, 0, 0 );
        rect(scoreBoxProperties.leftBorderX,scoreBoxProperties.upperBorderY + ((distBetweenGames+gameBoxHeight)*i),scoreBoxProperties.leftBorderX+16+inningBGWidth,scoreBoxProperties.upperBorderY + 30 + ((distBetweenGames+gameBoxHeight)*i), mainBoxesCornerRoundness, mainBoxesCornerRoundness, mainBoxesCornerRoundness, mainBoxesCornerRoundness );
        fill( 255 );
        text( "FINAL", scoreBoxProperties.leftBorderX + 8, scoreBoxProperties.upperBorderY + 15 + ((gameBoxHeight+distBetweenGames)*i) );
      }
      
      fill( weatherIcons[games[i].weather].background );
      rect( scoreBoxProperties.leftBorderX+inningBGWidth+16, scoreBoxProperties.upperBorderY + ((distBetweenGames+gameBoxHeight)*i), scoreBoxProperties.leftBorderX+inningBGWidth+46, scoreBoxProperties.upperBorderY + ((distBetweenGames+gameBoxHeight)*i) + 30, mainBoxesCornerRoundness, mainBoxesCornerRoundness, mainBoxesCornerRoundness, mainBoxesCornerRoundness );
      if( weatherIcons[games[i].weather].image != "" ) {
        image( weatherIcons[games[i].weather].image, scoreBoxProperties.leftBorderX+inningBGWidth+18, scoreBoxProperties.upperBorderY + ((distBetweenGames+gameBoxHeight)*i) + 2, 26, 26 );
      }
      
      
      fill(255);
      textAlign(RIGHT,CENTER);
      text( games[i].seriesIndex + " of " + games[i].seriesLength, scoreBoxProperties.rightBorderX - 10, scoreBoxProperties.upperBorderY + 15 + ((gameBoxHeight+distBetweenGames)*i) );
      
      textAlign(LEFT,TOP);
      textSize(15);
      text( games[i].lastUpdate, updateBoxProperties.leftBorderX+10, updateBoxProperties.upperBorderY+40+((gameBoxHeight+distBetweenGames)*i), updateBoxProperties.width-20);
      
      if( games[i].awayScore > 0 && !tracks[i*2].playing() && startNewTrack) {
        tracks[i*2].play();
      }
      if( games[i].homeScore > 0 && !tracks[(i*2)+1].playing()  && startNewTrack) {
        tracks[(i*2)+1].play();
      }
      
      textAlign(CENTER,CENTER);
      textSize( (trackAmplitude[i*2].getLevel() * scoreBounciness * games[i].awayScore) + (20+games[i].awayScore));
      text (games[i].awayScore, scoreBoxProperties.rightBorderX-30, scoreBoxProperties.upperBorderY+63+((gameBoxHeight+distBetweenGames)*i) );
      textSize( (trackAmplitude[(i*2)+1].getLevel() * scoreBounciness * games[i].homeScore) + (20+games[i].homeScore));
      text( games[i].homeScore, scoreBoxProperties.rightBorderX-30, scoreBoxProperties.upperBorderY+117+((gameBoxHeight+distBetweenGames)*i) );
      
      fill(games[i].awayTeamColor);
      circle( scoreBoxProperties.leftBorderX+40, scoreBoxProperties.upperBorderY+63+((gameBoxHeight+distBetweenGames)*i), 45 );
      fill(games[i].homeTeamColor);
      circle( scoreBoxProperties.leftBorderX+40, scoreBoxProperties.upperBorderY+117+((gameBoxHeight+distBetweenGames)*i), 45 );
      textSize( 30 );
      if(games[i].awayTeamName == "Tokyo Lift") {
        text( "🏋️‍♂️", scoreBoxProperties.leftBorderX+40, scoreBoxProperties.upperBorderY+65+((gameBoxHeight+distBetweenGames)*i) );
      } else {
        text( String.fromCodePoint(games[i].awayTeamEmoji), scoreBoxProperties.leftBorderX+40, scoreBoxProperties.upperBorderY+65+((gameBoxHeight+distBetweenGames)*i) );
      }
      if(games[i].homeTeamName == "Tokyo Lift") {
        text( "🏋️‍♂️", scoreBoxProperties.leftBorderX+40, scoreBoxProperties.upperBorderY+120+((gameBoxHeight+distBetweenGames)*i) );
      } else {
        text( String.fromCodePoint(games[i].homeTeamEmoji), scoreBoxProperties.leftBorderX+40, scoreBoxProperties.upperBorderY+120+((gameBoxHeight+distBetweenGames)*i) );
      }
      
      textAlign(LEFT,TOP);
      textSize( 20 );
      fill(games[i].awayTeamColor)
      text( games[i].awayTeamNickname, scoreBoxProperties.leftBorderX+80, scoreBoxProperties.upperBorderY+43+((gameBoxHeight+distBetweenGames)*i), scoreBoxProperties.width-150 );
      fill(games[i].homeTeamColor)
      text( games[i].homeTeamNickname, scoreBoxProperties.leftBorderX+80, scoreBoxProperties.upperBorderY+98+((gameBoxHeight+distBetweenGames)*i), scoreBoxProperties.width-130 );
      
      textSize( 15 );
      fill(150);
      text( standings.wins[games[i].awayTeam] + "-" + standings.losses[games[i].awayTeam], scoreBoxProperties.leftBorderX+80, scoreBoxProperties.upperBorderY+70+((gameBoxHeight+distBetweenGames)*i) );
      text( standings.wins[games[i].homeTeam] + "-" + standings.losses[games[i].homeTeam], scoreBoxProperties.leftBorderX+80, scoreBoxProperties.upperBorderY+125+((gameBoxHeight+distBetweenGames)*i) );
      
      textSize( 12 );
      fill(255);
      textStyle(BOLD);
      text( "PITCHING", infoBoxProperties.leftBorderX+25, infoBoxProperties.bottomBorderY-55+((gameBoxHeight+distBetweenGames)*i) );
      text( "BATTING", infoBoxProperties.leftBorderX+25, infoBoxProperties.bottomBorderY-30+((gameBoxHeight+distBetweenGames)*i) );
      text( "BALLS", infoBoxProperties.rightBorderX-125, infoBoxProperties.upperBorderY+18+((gameBoxHeight+distBetweenGames)*i) );
      text( "STRIKES", infoBoxProperties.rightBorderX-125, infoBoxProperties.upperBorderY+40+((gameBoxHeight+distBetweenGames)*i) );
      text( "OUTS", infoBoxProperties.rightBorderX-125, infoBoxProperties.upperBorderY+62+((gameBoxHeight+distBetweenGames)*i) );
      textStyle(NORMAL);
      
      var base1 = games[i].basesOccupied.includes(0);
      var base2 = games[i].basesOccupied.includes(1);
      var base3 = games[i].basesOccupied.includes(2);
      var firstBoxX = infoBoxProperties.leftBorderX+30;
      var firstBoxY = infoBoxProperties.upperBorderY+55+((gameBoxHeight+distBetweenGames)*i);
      stroke(255);
      strokeWeight(1.5);
      noFill();
      if(base3) { fill(255) }
      rotatedRect( firstBoxX, firstBoxY, firstBoxX+25, firstBoxY+25, -45 );
      noFill();
      if(base2) { fill(255) }
      rotatedRect( firstBoxX+20, firstBoxY-20, firstBoxX+45, firstBoxY+5, -45 );
      noFill();
      if(base1) { fill(255) }
      rotatedRect( firstBoxX+40, firstBoxY, firstBoxX+65, firstBoxY+25, -45 );
      fill(255);
      
      var batterName = games[i].awayBatterName;
      var pitcherName = games[i].homePitcherName;
      var totalBalls = games[i].awayBalls - 1;
      var totalStrikes = games[i].awayStrikes - 1;
      var totalOuts = games[i].awayOuts - 1;
      var pitcherColor = games[i].homeTeamColor;
      var batterColor = games[i].awayTeamColor;
      if(!games[i].topOfInning) {
        batterName = games[i].homeBatterName;
        pitcherName = games[i].awayPitcherName;
        totalBalls = games[i].homeBalls - 1;
        totalStrikes = games[i].homeStrikes - 1;
        totalOuts = games[i].homeOuts - 1;
        pitcherColor = games[i].awayTeamColor;
        batterColor = games[i].homeTeamColor;
      }
      var balls = games[i].atBatBalls;
      var strikes = games[i].atBatStrikes;
      var outs = games[i].halfInningOuts;
      
      fill(255);
      for(var b = 0; b < totalBalls; b++ ) {
        if( b+1 > balls ) { noFill(); }
        circle(infoBoxProperties.rightBorderX-25-(b*15), infoBoxProperties.upperBorderY+23+((gameBoxHeight+distBetweenGames)*i), 10 );
      }
      fill(255);
      for(var b = 0; b < totalStrikes; b++ ) {
        if( b+1 > strikes ) { noFill(); }
        circle(infoBoxProperties.rightBorderX-25-(b*15), infoBoxProperties.upperBorderY+45+((gameBoxHeight+distBetweenGames)*i), 10 );
      }
      fill(255);
      for(var b = 0; b < totalOuts; b++ ) {
        if( b+1 > outs ) { noFill(); }
        circle(infoBoxProperties.rightBorderX-25-(b*15), infoBoxProperties.upperBorderY+67+((gameBoxHeight+distBetweenGames)*i), 10 );
      }
      noStroke();
      
      if( pitcherName == "" ) { pitcherName = "-"; }
      if( batterName == "" ) { batterName = "-"; }
      
      var pitcherNameWidth = textWidth(pitcherName);
      var batterNameWidth = textWidth(batterName);
      var pColor = color( pitcherColor );
      var bColor = color( batterColor );
      
      pColor.setAlpha(150);
      bColor.setAlpha(150);
      
      fill( pColor );
      rect( infoBoxProperties.rightBorderX-20-pitcherNameWidth-20, infoBoxProperties.bottomBorderY-57+((gameBoxHeight+distBetweenGames)*i), infoBoxProperties.rightBorderX-20, infoBoxProperties.bottomBorderY-42+((gameBoxHeight+distBetweenGames)*i), mainBoxesCornerRoundness, mainBoxesCornerRoundness, mainBoxesCornerRoundness, mainBoxesCornerRoundness );
      fill( bColor );
      rect( infoBoxProperties.rightBorderX-20-batterNameWidth-20, infoBoxProperties.bottomBorderY-32+((gameBoxHeight+distBetweenGames)*i), infoBoxProperties.rightBorderX-20, infoBoxProperties.bottomBorderY-17+((gameBoxHeight+distBetweenGames)*i), mainBoxesCornerRoundness, mainBoxesCornerRoundness, mainBoxesCornerRoundness, mainBoxesCornerRoundness );
      
      fill(255);
      textAlign(RIGHT,TOP);
      text( pitcherName, infoBoxProperties.rightBorderX-30, infoBoxProperties.bottomBorderY-55+((gameBoxHeight+distBetweenGames)*i) );
      textAlign(RIGHT,TOP);
      text( batterName, infoBoxProperties.rightBorderX-30, infoBoxProperties.bottomBorderY-30+((gameBoxHeight+distBetweenGames)*i) );
      
    }
  }
  
}






function setBoxProperties() {
  infoBoxProperties = {
    "width" : infoBoxWidth,
    "height" : gameBoxHeight,
    "leftBorderX" : centerWidth - infoBoxWidth/2,
    "rightBorderX" : centerWidth + infoBoxWidth/2,
    "upperBorderY" : headerMargin,
    "bottomBorderY" : headerMargin + gameBoxHeight
  };
  scoreBoxProperties = {
    "width" : scoreBoxWidth,
    "height" : gameBoxHeight,
    "leftBorderX" : centerWidth - infoBoxWidth/2 - distBetweenBoxes - scoreBoxWidth,
    "rightBorderX" : centerWidth - infoBoxWidth/2 - distBetweenBoxes,
    "upperBorderY" : headerMargin,
    "bottomBorderY" : headerMargin + gameBoxHeight
  };
  updateBoxProperties = {
    "width" : updateBoxWidth,
    "height" : gameBoxHeight,
    "leftBorderX" : centerWidth + infoBoxWidth/2 + distBetweenBoxes,
    "rightBorderX" : centerWidth + infoBoxWidth/2 + distBetweenBoxes + updateBoxWidth,
    "upperBorderY" : headerMargin,
    "bottomBorderY" : headerMargin + gameBoxHeight
  };
}

function setGameOrder(gameUpdate) {
  var gamesReset = [];
  
  if( !gamesOrderSet && gameUpdate[0] != null && gameUpdate[0].lastUpdate != "" ) {
    for(var i = 0; i < 12; i++ ) {
      gamesOrder[i] = gameUpdate[i].id;
    }
    gamesReset = gameUpdate;
    gamesOrderSet = true;
  }
  else if( gameUpdate[0] != null ) {
    for(var i = 0; i < 12; i++ ) {
      for(var a = 0; a < 12; a++) {
        if( gameUpdate[a].id == gamesOrder[i] ) {
          gamesReset[i] = gameUpdate[a];
        }
      }
    }
  }
  
  return gamesReset;
}

function toggleAudio() {
  if(soundOn) {
    Howler.mute(true);
    soundOn = false;
    soundToggleButton.html("Sound: OFF");
  } else {
    Howler.mute(false);
    soundOn = true;
    soundToggleButton.html("Sound: ON");
  }
}


function assignTracks() {
  var trackMarkOff = [];
  var randFilePaths = [];
  
  for(var a = 0; a < kitFiles.info.numOfFolders; a++) {
    trackMarkOff[a] = [];
    for(var b = 0; b < kitFiles.folders[a].fileCount; b++ ) {
      trackMarkOff[a][b] = false;
    }
  }
  
  for(var i = 0; i < 24; i++) {
    var trackFilePath = "";
    var searchingForUnusedTrack = true;
    while(searchingForUnusedTrack) {
      var randomFolderNum = floor(random(kitFiles.info.numOfFolders));
      var numFilesInFolder = kitFiles.folders[randomFolderNum].fileCount;
      var randomFileNum = floor(random(numFilesInFolder));
      
      if( !trackMarkOff[randomFolderNum][randomFileNum] ) {
        var trackFilePath = kitFiles.folders[randomFolderNum].filePaths[randomFileNum];
        trackMarkOff[randomFolderNum][randomFileNum] = true;
        searchingForUnusedTrack = false;
      }
    }
    randFilePaths[i] = trackFilePath;
  }
  
  return randFilePaths;
}


function rotatedRect( x1, y1, x2, y2, rotation )  {
  translate(x1,y1);
  rotate(radians(rotation));
  rect(0,0,x2-x1,y2-y1);
  rotate(radians(-1*rotation));
  translate(-1*x1,-1*y1);
}
